import React from "react";
import styles from "./button.module.css";

const button = ({ style, clicked, btnType }) => {
  return (
    <button
      className={[styles.btn, btnType].join(" ")}
      onClick={clicked}
      style={{ ...style }}
    >
      {children}
    </button>
  );
};
export default button;
